static inline int handleint()
{
    char*s = nrbuf();
    char l = (as3_text[0]=='-');

    //char*max = l?"1073741824":"2147483647";
    char*max = l?"2147483648":"2147483647";

    if(as3_leng-l>10) {
        as3_softwarning("integer overflow: %s (converted to Number)", s);
        return handlefloat();
    }
    if(as3_leng-l==10) {
        int t;
        for(t=0;t<as3_leng-l;t++) {
            if(as3_text[l+t]>max[t]) {
                as3_softwarning("integer overflow: %s (converted to Number)", s);
                return handlefloat();
            }
            else if(as3_text[l+t]<max[t])
                break;
        }
    }
    if(as3_text[0]=='-') {
        int v = atoi(s);
        return setint(v);
    } else {
        unsigned int v = 0;
        int t;
        for(t=0;t<as3_leng;t++) {
            v*=10;
            v+=as3_text[t]-'0';
        }
        return setint(v);
    }
}

static inline int handlehexfloat()
{
    char l = (as3_text[0]=='-')+2;
    double d=0;
    char dot=0;
    double base=1;
    int t;
    for(t=l;t<as3_leng;t++) {
        char c = as3_text[t];
        if(c=='.') {
            dot=1;
            continue;
        }
        if(!dot) {
            d*=16;
        } else {
            base*=1/16.0;
        }
        if(c>='0' && c<='9')
            d+=(c&15)*base;
        else if((c>='a' && c<='f') || (c>='A' && c<='F'))
            d+=((c&0x0f)+9)*base;
    }
    return setfloat(d);
}
static inline int handlehex()
{
    char l = (as3_text[0]=='-')+2;
    int len = as3_leng;

    if(len-l>8) {
        char*s = nrbuf();
        syntaxerror("integer overflow %s", s);
    }

    int t;
    unsigned int v = 0;
    for(t=l;t<len;t++) {
        v<<=4;
        char c = as3_text[t];
        if(c>='0' && c<='9')
            v|=(c&15);
        else if((c>='a' && c<='f') || (c>='A' && c<='F'))
            v|=(c&0x0f)+9;
    }
    if(l && v>=0x80000000) {
        char*s = nrbuf();
        as3_softwarning("integer overflow: %s (converted to Number)", s);
        return setfloat(v);
    }
    if(!l && v>0x7fffffff) {
        char*s = nrbuf();
        as3_softwarning("integer overflow: %s (converted to Number)", s);
        return setfloat(v);
    }

    if(l==3) {
        return setint(-(int)v);
    } else {
        return setint(v);
    }
}

